import { 
   searchContainer, 
   searchInput,
   searchIcon,
   searchIconContainer
} from './SearchBar.styles'
export default function SearchBar(props) {
   return (
      <searchContainer>
         <searchInput type='search'/>
         <searchIconContainer>
            <searchIcon onClick={()=> props.onSearch(1)}/>
         </searchIconContainer>
      </searchContainer>
   );
}
